import React from 'react';
import Header from '../components/Header';
import './homepage.css';

function HomePage() {
  return (
    <div className='container'>
      <Header />
      <section id='banner' className='banner-container'>
        banner
      </section>
      <main>
        <section id='intro' className='intro-container'>
          intruction
        </section>
      </main>
    </div>
  );
}

export default HomePage;
